import Hobby from "../Layouts/Hobby";
import { CameraIcon, GlobeAmericasIcon, HeartIcon } from '@heroicons/react/20/solid'
import HobbyListData from "../../datas/HobbyListData.js"



function HobbyList() {
    return (
        <div className="flex flex-col grow gap-6 p-4 md:p-6">
            {HobbyListData.map((hobby, index) =>  <Hobby name={hobby.name} icon={hobby.icon} key={index} />)}
        </div>
    );
}

export default HobbyList;
